import React from 'react';

const HomeNavBar= ()=>{
    return(
        <nav>
        <ul>
          
         <li>
          <button className='homepage-button' >Home</button>
          </li>
          <li>
          <button className='homepage-button' to='/signup'>Sign-Up</button>
          </li>
          <li>
          <button className='homepage-button' to='/login'>Sign-In</button>
          </li>
          
      </ul>
    </nav>
    )
    
     
}
export default HomeNavBar;
